const Home = () => {
  return (
    <div>
      <img className="imgStyle" src="/images/main.jpg"></img>
      <a href="admin/login">로그인</a>
      <hr />
      <a href="admin/signup">회원가입</a>
    </div>
  );
};

export default Home;
